import React, { Component } from "react";
import Todos from "./components/Todos";

import "./App.css";

function App() {
  state = {
    todos: [
      {
        id: 1,
        title: "Take out the trash",
        complete: false,
      },
      {
        id: 2,
        title: "Take out the trash 2",
        complete: false,
      },
      {
        id: 3,
        title: "Take out the trash 3",
        complete: false,
      },
      {
        id: 4,
        title: "Take out the trash 4",
        complete: false,
      },
    ],
  };

  return (
    <div className="App">
      <Todos />
    </div>
  );
}

export default App;
